<!DOCTYPE html>
<html lang="pt-BR">
<head>
<meta charset="UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<title>Presell Desktop</title>
<style>
    body {
        margin: 0;
        padding: 20px;
        background: #fff;
        font-family: Arial, sans-serif;
        text-align: center;
        color: #111;
    }
    h2 {
        font-size: 24px;
        font-weight: bold;
    }
    img {
        width: 100%;
        max-width: 420px;
        display: block;
        margin: 20px auto;
    }
    p {
        font-size: 18px;
        margin: 10px 0;
    }
    .btn {
        display: inline-block;
        background-color: #ff0000;
        color: #fff;
        padding: 16px 34px;
        text-decoration: none;
        font-size: 20px;
        border-radius: 6px;
        font-weight: bold;
        margin-top: 20px;
    }
    .footer {
        font-size: 14px;
        color: #666;
        margin-top: 20px;
    }
    
.arrow {
    width: 0; 
    height: 0; 
    border-left: 18px solid transparent;
    border-right: 18px solid transparent;
    border-top: 28px solid red;
    margin: 10px auto;
    animation: bounce 1s infinite ease-in-out;
}
@keyframes bounce {
    0% { transform: translateY(0); }
    50% { transform: translateY(-10px); }
    100% { transform: translateY(0); }
}

</style>
